import React from "react";
import Tab from "./Tab";


class TabSection extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div id="tabDiv" className="flex container">
                <Tab tabName="wiki" />
                <Tab tabName="properties" />
            </div>
        );
    }
}


export default TabSection
